import React from 'react'
import { View } from 'react-native'
import tw from 'twrnc'

export default function ActiveOrderIndicator(props) {
  return (
    <View
    style={tw`w-2 h-2 bg-red-400 rounded-xl`}>
    
    </View>
  )
}
